import React ,{useState,useEffect} from 'react';
import Keanu from './Keanu';
import Posts from "./Posts";
import Users from "./Users";

export default function Feed (){
    const [like,setLike] = useState(0);
        useEffect(()=>{
            setLike(24);
        })

    return(
        <div className="container feed">
            <Posts />
            <Users />
            <Keanu like/>
        </div>
    )
}
